import { useContext, useEffect, useState } from "react";
import ResultBox from "../../components/ResultBox";
import { QuestionContext } from "../../context/QuestionContext";
import { fetchAnswers } from "../../api";
import "./styles.scss";

export default function Results() {
  const { state: { answers, email, questions }, dispatch } = useContext(QuestionContext);

  const [answerResults, setAnswerResults] = useState(null);

  useEffect(() => {
    fetchAnswers(email);
  }, []);

  return (
    <div className="results-page">
      <div>
        <h1>Your Perspective</h1>
        <h2>Your Perspective Type is ENTJ</h2>
      </div>
      <div>
        <ResultBox leftText="Introversion(I)" rightText="Extroversion(E)" />
        <ResultBox leftText="Sensing (S)" rightText="Intuition (N)" />
        <ResultBox leftText="Thinking (T)" rightText="Feeling (F)" />
        <ResultBox leftText="Judging (J)" rightText="Perceiving (P)" />
      </div>
    </div>
  );
}
